             mergeTwoLists(merge(0,1), merge(2,2))        mergeTwoLists(merge(3,3), merge(4,4))
                                            ||                                ||       ||
   mergeTwoLists(merge(0,0), merge(1,1)) lists[2]                          lists[3] lists[4]
                      ||        ||
                    lists[0] lists[1]
