public static String addBinary(String a, String b) {
    StringBuilder sb = new StringBuilder();

    int i=a.length()-1;
    int j=b.length()-1;

    int carry = 0;

    while(i>=0 || j>=0){
        int sum=0;

        if(i>=0 && a.charAt(i)=='1'){
            sum++;    
        }

        if(j>=0 && b.charAt(j)=='1'){
            sum++;
        }

        sum += carry;

        if(sum>=2){
            carry=1;
        }else{
            carry=0;
        }

        sb.insert(0,  String.valueOf(sum%2));

        i--;
        j--;
    }

    if(carry==1)
        sb.insert(0, '1');

    return sb.toString();
}

