class Solution {

    int preIndex = 0;

    public TreeNode buildTree(int[] preorder, int[] inorder) {  

        int inStart = 0;
        int inEnd = inorder.length-1;

        return buildTree(preorder, inorder, inStart, inEnd);
    }

