public void flatten(TreeNode root) {
    TreeNode node = root;
    while (node != null) {
        TreeNode left = node.left;
        TreeNode right = node.right;
        if (left != null) {
            TreeNode temp = left;
            while (temp.right != null)
                temp = temp.right;
            temp.right = right;
            node.right = left;
            node.left = null;
        }
        node = node.right;
    }
}

