    int result = 0;
    if(root==null)
        return result;

    ArrayList> all = new ArrayList>();
    ArrayList l = new ArrayList();
    l.add(root);
    dfs(root, l, all);

    for(ArrayList a: all){
        StringBuilder sb = new StringBuilder();
        for(TreeNode n: a){
            sb.append(String.valueOf(n.val));
        }
        int currValue = Integer.valueOf(sb.toString());
        result = result + currValue;
    }

    return result;
}

public void dfs(TreeNode n, ArrayList l,  ArrayList> all){
    if(n.left==null && n.right==null){
        ArrayList t = new ArrayList();
        t.addAll(l);
        all.add(t);
    }

    if(n.left!=null){
        l.add(n.left);
        dfs(n.left, l, all);
        l.remove(l.size()-1);
    }

    if(n.right!=null){
        l.add(n.right);
        dfs(n.right, l, all);
        l.remove(l.size()-1);
    }

}

