143. Reorder List
Given a singly linked list L0 -> L1 -> … -> Ln-1 -> Ln. Rearrange the nodes in the list so that the new formed list is : L0 -> Ln -> L1 -> Ln-1 -> L2 -> Ln-2 …
Examples: 
Input:  1 -> 2 -> 3 -> 4
Output: 1 -> 4 -> 2 -> 3
Input:  1 -> 2 -> 3 -> 4 -> 5
Output: 1 -> 5 -> 2 -> 4 -> 3
Algorithm:

Find the middle point using tortoise and hare method.
Split the linked list into two halves using found middle point in step 1.
Reverse the second half.
Do alternate merge of first and second halves.

Solution:
ListNode reverselist(ListNode node) {

    ListNode prev = null, curr = node, next;

    while (curr != null) {
        next = curr.next;
        curr.next = prev;
        prev = curr;
        curr = next;
    }

    node = prev;
    return node;
}

void reorderList(ListNode node) {

    // 1) Find the middle point using tortoise and hare method
    ListNode slow = node, fast = node;
    while (fast.next != null && fast.next.next != null) {
        slow = slow.next;
        fast = fast.next.next;
    }

    // 2) Split the linked list in two halves
    // node1, head of first half    1 -> 2 -> 3
    // node2, head of second half   4 -> 5
    ListNode node1 = node;
    ListNode node2 = slow.next;
    slow.next = null;

    // 3) Reverse the second half, i.e., 5 -> 4
    node2 = reverselist(node2);

    // 4) Merge alternate nodes
    node = new ListNode(0); // Assign dummy ListNode

    // curr is the pointer to this dummy ListNode, which
    // will be used to form the new list
    ListNode curr = node;
    while (node1 != null || node2 != null) {

        // First add the element from first list
        if (node1 != null) {
            curr.next = node1;
            curr = curr.next;
            node1 = node1.next;
        }

        // Then add the element from second list
        if (node2 != null) {
            curr.next = node2;
            curr = curr.next;
            node2 = node2.next;
        }
    }

    // Assign the head of the new list to head pointer
    node = node.next;
}

