class Queue {
    // Initialize front and rear
    int rear, front;

    // Circular Queue
    int size;
    int[] arr;

    Queue(int s) {
       front = rear = -1;
       size = s;
       arr = new int[s];
    }

    void enQueue(int value) {

        if ((front == 0 && rear == size - 1) || rear == front - 1) {
            System.out.println("Queue is Full");
            return;
        }
        else if (front == -1) { /* Insert First Element */
            front = rear = 0;
            arr[rear] = value;
        }
        else if (rear == size - 1 && front != 0) {
            rear = 0;
            arr[rear] = value;
        }
        else {
            rear++;
            arr[rear] = value;
        }

    }

    int deQueue() {

        if (front == -1) {
            System.out.println("Queue is Empty");
            return Integer.MIN_VALUE;
        }

        int data = arr[front];

        if (front == rear) {
            front = -1;
            rear = -1;
        }
        else if (front == size - 1) {
            front = 0;
        }
        else {
            front++;
        }

        return data;
    }

}

